      <div key={ninja.id}>
        <p>name: {ninja.name}</p>
          <p>age: {ninja.age}</p>
        <p>belt: {ninja.belt} </p>
        <button className ="btn btn-danger btn-sm">Delete ninja</button>

    <br/>
      </div>
)
  })
  return (
    <div>
      { ninjaList }
    </div>
  )
}


export default Ninjas;
